import React from "react";
import '../styles/home.style.css'
import { config } from '../config'
import axios from 'axios'

class Home extends React.Component {

     GetBroadCasters = async () => {
          try {
               let res = await axios.get(`http://${config.NODE_IP}:${config.NODE_PORT}/broadcaster/list`)
               let broadcaster = await res.data
               return broadcaster
          } catch (error) {
               console.log(error)
               return
          }
     }

     render() {
          let broadcasters = this.GetBroadCasters();
          console.log(broadcasters)
          return (
               <div>
                    <h1>Streamer online</h1>
